values:
Linny, darling~~~~~? Why didn't you tell me you had one of these silly journals sooner? I would've gotten on here far sooner if I had known! 

Soooo.

Good morning/afternoon/evening! I am Ba Bing Long, the handsome husband of our beloved Lin Yao~! And believe me, children, when I say that the pleasure is mine in meeting all of you. &hearts;
